import React from 'react';
import "./ComponentOneL.css";
import {Spring} from 'react-spring';

const ComponentOneL = () => {
    const cLstyle = {
        border: '1px solid #ccc',
    }
  return (
    <Spring
        from={{opacity: 0}}
        to={{opacity: 1}}

    >
        {
            props => (
                <div style={props}>
                    <div style={cLstyle}>
                        ComponentOneL
                    </div>
                </div>
            )
        }
        
    </Spring>
  )
}

export default ComponentOneL;
